import React, { useState, useEffect } from 'react';
import { useCart } from '../CartContext';
import { useNavigate } from 'react-router-dom';
import Header from '../components/LoginHeader';

function CheckoutPage() {
  const { cart, clearCart, storeLocations } = useCart();
  const [email, setEmail] = useState(''); // Email state
  const [storeDetails, setStoreDetails] = useState([]); // State to hold store details

  // Fetch store details from the API
  const fetchStoreDetails = async () => {
    try {
      const response = await fetch('/api/stores'); // Update with your API endpoint
      const data = await response.json();
      setStoreDetails(data);
    } catch (error) {
      console.error('Error fetching store details:', error);
    }
  };

  // Fetch store details on component mount
  useEffect(() => {
    fetchStoreDetails();
  }, []);

  // ... other states and logic

  // Handle form submission
  const handleSubmit = (e) => {
    e.preventDefault();

    const order = {
      // ... other order details
      email, // Add email to the order
      // ... rest of the order details
    };

    // ... remaining handleSubmit logic
  };

  return (
    <>
      <Header />
      <div className="checkout-page">
        <h2>Checkout</h2>
        <div className="checkout-container">
          <div className="order-summary">
            <h3>Order Summary</h3>
            {cart.length === 0 ? (
              <p>Your cart is empty.</p>
            ) : (
              <form onSubmit={handleSubmit}>
                {/* Display cart items */}
                <h3>Items in Cart</h3>
                {cart.map(item => (
                  <div key={item.id} className="cart-item">
                    <p><strong>{item.name}</strong></p>
                    <p>Price: ${item.price}</p>
                    <p>Quantity: {item.quantity}</p>
                    <div className="form-group">
                      <label>
                        <input
                          type="checkbox"
                          checked={selectedWarranty[item.name] || false}
                          onChange={(e) => handleWarrantyChange(item.name, e.target.checked)}
                        />
                        Add Warranty (${warrantyCost})
                      </label>
                    </div>
                  </div>
                ))}

                {/* Totals */}
                {/* ... totals section */}

                {/* Customer Information Form */}
                <h3>Customer Information</h3>
                <div className="form-group">
                  <label>Name:</label>
                  <input
                    type="text"
                    value={name}
                    onChange={(e) => setName(e.target.value)}
                    required
                  />
                </div>

                {/* New Email Field */}
                <div className="form-group">
                  <label>Email:</label>
                  <input
                    type="email"
                    value={email}
                    onChange={(e) => setEmail(e.target.value)}
                    required
                  />
                </div>

                {/* ... other fields */}

                {deliveryType === 'store' && (
                  <div className="form-group">
                    <label>Select Store:</label>
                    <select value={selectedStore} onChange={(e) => setSelectedStore(e.target.value)}>
                      <option value="">Select a store</option>
                      {storeDetails && storeDetails.map((store) => (
                        <option key={store.id} value={store.id}>
                          {store.name} - {store.zipCode}
                        </option>
                      ))}
                    </select>
                  </div>
                )}

                <button type="submit">Place Order</button>
              </form>
            )}
          </div>
        </div>
      </div>
    </>
  );
}

export default CheckoutPage;
